import React from "react";

const Test = () => {
  return (
    <div>
      <section class="hero is-link is-fullheight-with-navbar">
        <div class="hero-body">
          <div class="container">
            <p class="title">Fullheight hero with navbar</p>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Test;
